import React from "react";

const Listing = ({ data, tags, updateFilters }) => {
  const listingTags = tags.map((tag) => <span>{tag}</span>);

  return (
    <article className='listing'>
      <div className='listing__img'>X</div>
      <div className='listing__info-wrapper'>
        <div className='listing__info'>
          <h1>{data.position}</h1>
          <div className='listing__info-company'></div>
        </div>
        <div className='listing__tags'>{listingTags}</div>
      </div>
    </article>
  );
};

export default Listing;
